INSERT INTO `clinics` VALUES (1,'Bệnh viện Hữu nghị Việt Đức','Số 16-18 Phủ Doãn - Hoàn Kiếm - Hà Nội','**GIỚI THIỆU**\n\n**Địa chỉ:  Bệnh viện có nhiều cổng, bệnh nhân đến khám sẽ đến cổng:** \n\nSố 16 - 18 Phủ Doãn, Hoàn Kiếm, Hà Nội\nThời gian làm việc: Thứ 2 đến thứ 7\n\nSáng: 7h00 - 12h00\nChiều: 13h30 - 16h30\nBệnh viện Việt Đức là một trong 5 bệnh viện tuyến Trung ương, hạng đặc biệt của Việt Nam. Bệnh viện có lịch sử trên 100 năm, bề dày truyền thống danh tiếng, là cái nôi của ngành ngoại khoa Việt Nam gắn liền với những thành tựu Y học quan trọng của đất nước. \n\nViệt Đức là địa chỉ uy tín hàng đầu về ngoại khoa, tiến hành khám bệnh, chữa bệnh và thực hiện các kỹ thuật chụp chiếu, xét nghiệm, thăm dò chức năng cơ bản và chuyên sâu hàng ngày cho người dân. \n\nBệnh viện có đội ngũ y bác sĩ hùng hậu, nhiều người kiêm là cán bộ giảng dạy tại Đại học Y khoa Hà Nội hoặc Khoa Y Dược - Đại học Quốc gia Hà Nội. Trong số họ nhiều người là chuyên gia đầu ngành và bác sĩ giàu kinh nghiệm ở các chuyên khoa khác nhau. \n\n**Lưu ý quan trọng**\n\nBệnh viện có nhiều khu khám bệnh, hiện tại BookingCare đang hỗ trợ đăng ký khám tại tòa nhà C4 - Khoa khám bệnh theo yêu cầu. Người bệnh đến khám đúng tòa nhà C4 để được hỗ trợ.\nBệnh viện chuyên về Ngoại khoa nên lịch của các bác sĩ thường linh động và ưu tiên khám cho các ca cấp cứu.\nMỗi bệnh nhân trong ngày chỉ được đặt trước 1 chuyên khoa, nếu đăng kí 2 chuyên khoa trở lên sẽ trao đổi bác sĩ thăm khám ban đầu chuyển khám thêm khoa khác.\nChi phí khám\n\n**Người bệnh có thể lựa chọn một trong các gói khám sau:**\n\n***Gói 1***:\nKhám Giáo sư, Phó Giáo sư, Tiến sĩ, Bác sĩ Chuyên khoa II - Chi phí 500.000 đồng/lần khám\nKhám với bác sĩ Trưởng khoa hoặc Phó khoa - Chi phí 500.000 đồng/lần khám\n\n***Gói 2***:\nKhám Thạc sĩ, Bác sĩ Chuyên khoa I - Chi phí: 300.000 đồng/lần khám\nTHẾ MẠNH CHUYÊN MÔN\nBệnh viện Việt Đức là bệnh viện chuyên khoa Ngoại (phẫu thuật), có thế mạnh về khám, điều trị và Phẫu thuật nhiều chuyên khoa. Một số thế mạnh của Bệnh viện Việt Đức là:\n\nKhám, điều trị, phẫu thuật về Thần kinh (Thần kinh I, Thần kinh II): Chấn thương; Bệnh lý sọ não; Tuỷ sống; Dây thần kinh ngoại vi; Ứng dụng nội soi trong phẫu thuật thần kinh; Phẫu thuật thần kinh chức năng; Phẫu thuật u nền sọ;...\nKhám, điều trị, phẫu thuật về Cơ xương khớp:\nKhám, điều trị, phẫu thuật về Chi trên và Y học thể thao: Khám các bệnh lý do chấn thương thể thao; Bệnh lý đứt dây chằng gối do chơi thể thao; Chấn thương chỉnh hình xương khớp; Phẫu thuật bàn tay; Bệnh lý cơ xương khớp về tay;...\nKhám, điều trị, phẫu thuật về Chi dưới: Điều trị thoái hóa khớp gối, khớp háng; Bệnh lý đứt dây chằng gối; Phẫu thuật khớp gối, khớp háng, khớp cổ chân; Bệnh lý về chân;...\nKhám, điều trị, phẫu thuật về Xương và điều trị ngoại trú: Nắn chỉnh về xương, tai nạn bị gãy tay gãy chân, tháo bột, kiểm tra lại sau khi nắn chỉnh về xương.\nKhám, điều trị, phẫu thuật về chấn thương chung: tháo đinh, kiếm tra lại sau mổ,...\nKhám, điều trị, phẫu thuật về Cột sống: Bệnh lý cột sống; Đau vai gáy; Thoái hoá và thoát vị đĩa đệm; Chấn thương chỉnh hình cột sống; Trượt đốt sống; Vẹo cột sống; Bơm xi-măng vào thân đốt sống;...\nKhám, điều trị, phẫu thuật về Tim mạch và lồng ngực: Khám và điều trị bệnh lý tim bẩm sinh trẻ em; Khám và điều trị các bệnh lý nội, ngoại khoa về tim mạch; Điều trị các bệnh lý phức tạp về động - tĩnh mạch bằng các phương pháp tiên tiến; Các bệnh lý về xương sườn;...\nKhám, điều trị, phẫu thuật về Tạo hình-Hàm mặt-Thẩm mỹ: Bệnh lý và chấn thương vùng hàm mặt; Phục hồi tái tạo các cơ quan sau điều trị ung thư; Sửa chữa các dị tật sọ mặt; Nối vành tai đứt rời, mũi đứt rời ; Phẫu thuật thẩm mĩ mi mắt, mũi, tạo hình ngực, bụng….\nKhám, điều trị, phẫu thuật về Tiêu hóa: Cắt bỏ và tạo hình thực quản; Cắt khối tá tuỵ; Cắt toàn bộ dạ dày, cắt đại tràng các loại.\nNgoài ra, bệnh viện khám, điều trị, phâu thuật các chuyên khoa khác như:\n\n**Bệnh lý thần kinh**\n\n* Nội - Hồi sức thần kinh\n* Bệnh tim mạch và lồng ngực\n* Phẫu thuật tim mạch - lồng ngực\n* Ngoại nhi và trẻ sơ sinh\n* Bệnh lý tiêu hóa\n* Phẫu thuật tiêu hóa\n* Bệnh cột sống/thoát vị đĩa đệm\n* Chi trên và y học  thể thao\n* Bệnh lý chi dưới\n* Khám xương và điều trị ngoại trú\n* Phẫu thuật chấn thương chung\n* Phẫu thuật tạo hình - hàm mặt - thẩm mỹ\n* Phục hồi chức năng\n* Nhiễm khuẩn\n* Phẫu thuật nhiễm khuẩn\n* Bệnh đường tiết niệu\n* Bệnh nam học/nam khoa\n\n**Bệnh lý gan mật**\n\n* Ung bướu\n* Thận lọc máu\n* Bệnh lý hậu môn trực tràng\n* Trung tâm ghép tạng\n* Phòng khám Tai mũi họng\n\n**TRANG THIẾT BỊ**\n\nBệnh viện Việt Đức được trang bị hầu hết các trang thiêt bị hiện đại hàng đầu hiện nay phục vụ trong chẩn đoán và thực hiện các xét nghiệm cơ bản, xét nghiệm kỹ thuật cao như các xét nghiệm theo dõi bệnh nhân ghép tạng, các xét nghiệm chỉ điểm khối u.\n\n* Xquang số hóa\n* Máy siêu âm\n* Máy chụp cắt lớp vi tính đa dãy CT Scan\n* Máy chụp cộng hưởng từ MRI 3.0 Tesla\n* Hệ thống chụp mạch máy chuyên dụng\n* Hệ thống PET/CT phát hiện ung thư sớm và đánh giá các bệnh lý tim mạch, thần kinh\n* Hệ thống máy sinh hóa miễn dịch tự động, máy sinh hóa tự động, máy xét nghiệm huyết học, xét nghiệm đông máu tự động…\n\nCác thiết bị thăm dò chức năng hỗ trợ thăm khám và thực hiện các thủ thuật nội soi tiêu hóa - gan mật.\n\n* Nội soi thực quản - dạ dày - tá tràng chẩn đoán\n* Nội soi đại trực tràng chẩn đoán\n* Nội soi đường mật - tụy ngược dòng ERCP\n* Siêu âm nội soi chẩn đoán bệnh lý thuộc cơ quan tiêu hóa, chọc hút tế bào\n* Nội soi can thiệp, nong hẹp đường tiêu hóa\n* Nội soi đặt stent khí quản, đặt sonde tá tràng\n* Nội soi can thiệp đại tràng.\n\n\n![](https://www.isgltd.com/-/media/images/isg/components/title-with-image-component/image/healthcare-facility-projects---isg.jpg?h=1068&w=1920&hash=8144440258F1F19455A58C2A70D04F10&usecustomfunctions=1&centercrop=1)\n\nㅤ\nㅤ\n\n\n**THẾ MẠNH CHUYÊN MÔN**\n\nBệnh viện có 05 Trung tâm\n* Trung tâm Ung bướu Chợ Rẫy.\n* Trung tâm Đào tạo – Chỉ đạo tuyến.\n* Trung tâm Thông tin thuốc và theo dõi phản ứng thuốc có hại của thuốc khu vực Thành phố HCM.\n* Trung tâm Truyền máu Chợ Rẫy.\n* Trung tâm Tim mạch.\n* 38 Khoa Lâm sàng\n\n**04 Khoa khám bệnh ngoại trú:**\n\n* Khoa Khám bệnh I\n* Khoa Khám bệnh II\n* Khoa Chăm sóc sức khỏe theo yêu cầu.\n* Khoa Khám xuất cảnh.\n\n**34 Khoa lâm sàng.**\n\n1. Khoa Phẫu thuật – gây mê hồi sức.\n2. Khoa Hồi sức – phẫu thuật tim.\n3. Khoa Phẫu thuật mạch máu.\n4. Khoa Hồi sức cấp cứu.\n5. Khoa Hồi sức ngoại thần kinh.\n6. Khoa Chấn thương sọ não.\n7. Khoa Ngoại thần kinh (3B1,3B3, Đơn vị Gamma knife).\n8. Khoa Ngoại Tiêu hóa.\n9. Khoa Gan Mật Tụy.\n10. Khoa Ngoại Tiết Niệu.\n11. Khoa Chấn thương chỉnh hình.\n12. Khoa Tai Mũi họng.\n13. Khoa Tạo hình thẩm mỹ.\n14. Khoa Mắt.\n15. Khoa Ngoại lồng ngực.\n16. Khoa Nội tim mạch.\n17. Khoa Tim mạch can thiệp và Đơn vị Nhịp học.\n18. Khoa Nội phổi.\n19. Khoa Nội thận.\n20. Khoa Nội tiêu hóa.\n21. Khoa Nội thần kinh và Đơn vị Thăm dò chức năng thần kinh.\n22. Khoa Nội tổng quát (Lầu 9B1).\n23. Khoa Nội tổng quát – quốc tế (Lầu 10B1).\n24. Khoa Nội tổng quát (Lầu 10B3).\n25. Khoa Điều trị theo yêu cầu (T6).\n26. Khoa Bệnh nhiệt đới và Đơn vị Chống độc.\n27. Khoa Nghiên cứu & điều trị viêm gan.\n28. Khoa Phỏng – tạo hình.\n29. Khoa Nội tiết và Đơn vị Bàn chân đái tháo đường.\n30. Khoa Nội cơ xương khớp.\n31. Khoa Huyết học lâm sàng - Bộ phận Xét nghiệm huyết học và Đơn vị Điều trị trong ngày.\n32. Khoa Cấp cứu.\n33. Khoa Thận nhân tạo.\n34. Khoa Vật lý trị liệu.\n\n\n**SƠ ĐỒ BỆNH VIỆN**\n\nCác trang web khác ghi địa chỉ Bệnh viện Việt Đức ở 40 Tràng Thi, đây là cổng chính nhưng thông thường chỉ dành cho những công việc giấy tờ, hành chính. Bệnh nhân đến khám sẽ đi các cổng phụ trên đường Phủ Doãn. \n\n![](https://www.dchsystem.com/images/locations/regional-campus-map.jpg)\n\nTrên đường Phủ Doãn có 3 cổng và đường Tràng Thi có 1 cổng chính. Người bệnh nên đi đúng cổng như chỉ dẫn để đi đến phòng khám dễ dàng, nhanh chóng nhất.\n\n\n\n**QUY TRÌNH ĐI KHÁM**\n\nQuy trình khám dành cho người bệnh đặt khám thông qua BookingCare\n\n\n\nDưới đây là Hướng dẫn làm thủ tục ưu tiên cho người bệnh đặt khám qua BookingCare tại Bệnh viện Hữu nghị Việt Đức.\n\n1. Bạn đến cổng số 16-18 Phủ Doãn\n\nVề nơi gửi xe:\n\nXe máy gửi tại bãi đỗ xe trước cửa bệnh viện (có nhân viên bảo vệ hướng dẫn).\nXe ô tô gửi tại Cung Văn hóa Hữu nghị Việt Xô, cách bệnh viện khoảng 500m.\n\n\n2. Bạn đến Tòa nhà C4: Tòa nhà thứ 2 bên tay trái từ cổng vào số 16-18 Phủ Doãn.\n\n\n\n3. Vào tầng 1, ĐẾN QUẦY CUNG CẤP THÔNG TIN BÁO ĐẶT QUA BOOKINGCARE để nhân viên hỗ trợ (xem thêm hình dưới).\n\n\n\nQuý khách lấy số ưu tiên và chờ gọi số tại quầy đăng ký số 7,9 (phiếu khám đã được in sẵn, người bệnh KHÔNG cần khai báo thêm).\n4. Bạn sẽ nhận được phiếu khám có dán tem ưu tiên\n\n\n\n5. Bạn vào thẳng phòng khám, nộp phiếu khám, sổ khám bệnh và báo đã đặt khám qua BookingCare cho nhân viên điều dưỡng tại phòng để được ưu tiên khám.\n\n---','<p><strong>GIỚI THIỆU</strong></p>\n<p><strong>Địa chỉ:  Bệnh viện có nhiều cổng, bệnh nhân đến khám sẽ đến cổng:</strong></p>\n<p>Số 16 - 18 Phủ Doãn, Hoàn Kiếm, Hà Nội\nThời gian làm việc: Thứ 2 đến thứ 7</p>\n<p>Sáng: 7h00 - 12h00\nChiều: 13h30 - 16h30\nBệnh viện Việt Đức là một trong 5 bệnh viện tuyến Trung ương, hạng đặc biệt của Việt Nam. Bệnh viện có lịch sử trên 100 năm, bề dày truyền thống danh tiếng, là cái nôi của ngành ngoại khoa Việt Nam gắn liền với những thành tựu Y học quan trọng của đất nước.</p>\n<p>Việt Đức là địa chỉ uy tín hàng đầu về ngoại khoa, tiến hành khám bệnh, chữa bệnh và thực hiện các kỹ thuật chụp chiếu, xét nghiệm, thăm dò chức năng cơ bản và chuyên sâu hàng ngày cho người dân.</p>\n<p>Bệnh viện có đội ngũ y bác sĩ hùng hậu, nhiều người kiêm là cán bộ giảng dạy tại Đại học Y khoa Hà Nội hoặc Khoa Y Dược - Đại học Quốc gia Hà Nội. Trong số họ nhiều người là chuyên gia đầu ngành và bác sĩ giàu kinh nghiệm ở các chuyên khoa khác nhau.</p>\n<p><strong>Lưu ý quan trọng</strong></p>\n<p>Bệnh viện có nhiều khu khám bệnh, hiện tại BookingCare đang hỗ trợ đăng ký khám tại tòa nhà C4 - Khoa khám bệnh theo yêu cầu. Người bệnh đến khám đúng tòa nhà C4 để được hỗ trợ.\nBệnh viện chuyên về Ngoại khoa nên lịch của các bác sĩ thường linh động và ưu tiên khám cho các ca cấp cứu.\nMỗi bệnh nhân trong ngày chỉ được đặt trước 1 chuyên khoa, nếu đăng kí 2 chuyên khoa trở lên sẽ trao đổi bác sĩ thăm khám ban đầu chuyển khám thêm khoa khác.\nChi phí khám</p>\n<p><strong>Người bệnh có thể lựa chọn một trong các gói khám sau:</strong></p>\n<p><em><strong>Gói 1</strong></em>:\nKhám Giáo sư, Phó Giáo sư, Tiến sĩ, Bác sĩ Chuyên khoa II - Chi phí 500.000 đồng/lần khám\nKhám với bác sĩ Trưởng khoa hoặc Phó khoa - Chi phí 500.000 đồng/lần khám</p>\n<p><em><strong>Gói 2</strong></em>:\nKhám Thạc sĩ, Bác sĩ Chuyên khoa I - Chi phí: 300.000 đồng/lần khám\nTHẾ MẠNH CHUYÊN MÔN\nBệnh viện Việt Đức là bệnh viện chuyên khoa Ngoại (phẫu thuật), có thế mạnh về khám, điều trị và Phẫu thuật nhiều chuyên khoa. Một số thế mạnh của Bệnh viện Việt Đức là:</p>\n<p>Khám, điều trị, phẫu thuật về Thần kinh (Thần kinh I, Thần kinh II): Chấn thương; Bệnh lý sọ não; Tuỷ sống; Dây thần kinh ngoại vi; Ứng dụng nội soi trong phẫu thuật thần kinh; Phẫu thuật thần kinh chức năng; Phẫu thuật u nền sọ;...\nKhám, điều trị, phẫu thuật về Cơ xương khớp:\nKhám, điều trị, phẫu thuật về Chi trên và Y học thể thao: Khám các bệnh lý do chấn thương thể thao; Bệnh lý đứt dây chằng gối do chơi thể thao; Chấn thương chỉnh hình xương khớp; Phẫu thuật bàn tay; Bệnh lý cơ xương khớp về tay;...\nKhám, điều trị, phẫu thuật về Chi dưới: Điều trị thoái hóa khớp gối, khớp háng; Bệnh lý đứt dây chằng gối; Phẫu thuật khớp gối, khớp háng, khớp cổ chân; Bệnh lý về chân;...\nKhám, điều trị, phẫu thuật về Xương và điều trị ngoại trú: Nắn chỉnh về xương, tai nạn bị gãy tay gãy chân, tháo bột, kiểm tra lại sau khi nắn chỉnh về xương.\nKhám, điều trị, phẫu thuật về chấn thương chung: tháo đinh, kiếm tra lại sau mổ,...\nKhám, điều trị, phẫu thuật về Cột sống: Bệnh lý cột sống; Đau vai gáy; Thoái hoá và thoát vị đĩa đệm; Chấn thương chỉnh hình cột sống; Trượt đốt sống; Vẹo cột sống; Bơm xi-măng vào thân đốt sống;...\nKhám, điều trị, phẫu thuật về Tim mạch và lồng ngực: Khám và điều trị bệnh lý tim bẩm sinh trẻ em; Khám và điều trị các bệnh lý nội, ngoại khoa về tim mạch; Điều trị các bệnh lý phức tạp về động - tĩnh mạch bằng các phương pháp tiên tiến; Các bệnh lý về xương sườn;...\nKhám, điều trị, phẫu thuật về Tạo hình-Hàm mặt-Thẩm mỹ: Bệnh lý và chấn thương vùng hàm mặt; Phục hồi tái tạo các cơ quan sau điều trị ung thư; Sửa chữa các dị tật sọ mặt; Nối vành tai đứt rời, mũi đứt rời ; Phẫu thuật thẩm mĩ mi mắt, mũi, tạo hình ngực, bụng….\nKhám, điều trị, phẫu thuật về Tiêu hóa: Cắt bỏ và tạo hình thực quản; Cắt khối tá tuỵ; Cắt toàn bộ dạ dày, cắt đại tràng các loại.\nNgoài ra, bệnh viện khám, điều trị, phâu thuật các chuyên khoa khác như:</p>\n<p><strong>Bệnh lý thần kinh</strong></p>\n<ul>\n<li>Nội - Hồi sức thần kinh</li>\n<li>Bệnh tim mạch và lồng ngực</li>\n<li>Phẫu thuật tim mạch - lồng ngực</li>\n<li>Ngoại nhi và trẻ sơ sinh</li>\n<li>Bệnh lý tiêu hóa</li>\n<li>Phẫu thuật tiêu hóa</li>\n<li>Bệnh cột sống/thoát vị đĩa đệm</li>\n<li>Chi trên và y học  thể thao</li>\n<li>Bệnh lý chi dưới</li>\n<li>Khám xương và điều trị ngoại trú</li>\n<li>Phẫu thuật chấn thương chung</li>\n<li>Phẫu thuật tạo hình - hàm mặt - thẩm mỹ</li>\n<li>Phục hồi chức năng</li>\n<li>Nhiễm khuẩn</li>\n<li>Phẫu thuật nhiễm khuẩn</li>\n<li>Bệnh đường tiết niệu</li>\n<li>Bệnh nam học/nam khoa</li>\n</ul>\n<p><strong>Bệnh lý gan mật</strong></p>\n<ul>\n<li>Ung bướu</li>\n<li>Thận lọc máu</li>\n<li>Bệnh lý hậu môn trực tràng</li>\n<li>Trung tâm ghép tạng</li>\n<li>Phòng khám Tai mũi họng</li>\n</ul>\n<p><strong>TRANG THIẾT BỊ</strong></p>\n<p>Bệnh viện Việt Đức được trang bị hầu hết các trang thiêt bị hiện đại hàng đầu hiện nay phục vụ trong chẩn đoán và thực hiện các xét nghiệm cơ bản, xét nghiệm kỹ thuật cao như các xét nghiệm theo dõi bệnh nhân ghép tạng, các xét nghiệm chỉ điểm khối u.</p>\n<ul>\n<li>Xquang số hóa</li>\n<li>Máy siêu âm</li>\n<li>Máy chụp cắt lớp vi tính đa dãy CT Scan</li>\n<li>Máy chụp cộng hưởng từ MRI 3.0 Tesla</li>\n<li>Hệ thống chụp mạch máy chuyên dụng</li>\n<li>Hệ thống PET/CT phát hiện ung thư sớm và đánh giá các bệnh lý tim mạch, thần kinh</li>\n<li>Hệ thống máy sinh hóa miễn dịch tự động, máy sinh hóa tự động, máy xét nghiệm huyết học, xét nghiệm đông máu tự động…</li>\n</ul>\n<p>Các thiết bị thăm dò chức năng hỗ trợ thăm khám và thực hiện các thủ thuật nội soi tiêu hóa - gan mật.</p>\n<ul>\n<li>Nội soi thực quản - dạ dày - tá tràng chẩn đoán</li>\n<li>Nội soi đại trực tràng chẩn đoán</li>\n<li>Nội soi đường mật - tụy ngược dòng ERCP</li>\n<li>Siêu âm nội soi chẩn đoán bệnh lý thuộc cơ quan tiêu hóa, chọc hút tế bào</li>\n<li>Nội soi can thiệp, nong hẹp đường tiêu hóa</li>\n<li>Nội soi đặt stent khí quản, đặt sonde tá tràng</li>\n<li>Nội soi can thiệp đại tràng.</li>\n</ul>\n<p><img src=\"https://www.isgltd.com/-/media/images/isg/components/title-with-image-component/image/healthcare-facility-projects---isg.jpg?h=1068&amp;w=1920&amp;hash=8144440258F1F19455A58C2A70D04F10&amp;usecustomfunctions=1&amp;centercrop=1\" alt=\"\"></p>\n<p>ㅤ\nㅤ</p>\n<p><strong>THẾ MẠNH CHUYÊN MÔN</strong></p>\n<p>Bệnh viện có 05 Trung tâm</p>\n<ul>\n<li>Trung tâm Ung bướu Chợ Rẫy.</li>\n<li>Trung tâm Đào tạo – Chỉ đạo tuyến.</li>\n<li>Trung tâm Thông tin thuốc và theo dõi phản ứng thuốc có hại của thuốc khu vực Thành phố HCM.</li>\n<li>Trung tâm Truyền máu Chợ Rẫy.</li>\n<li>Trung tâm Tim mạch.</li>\n<li>38 Khoa Lâm sàng</li>\n</ul>\n<p><strong>04 Khoa khám bệnh ngoại trú:</strong></p>\n<ul>\n<li>Khoa Khám bệnh I</li>\n<li>Khoa Khám bệnh II</li>\n<li>Khoa Chăm sóc sức khỏe theo yêu cầu.</li>\n<li>Khoa Khám xuất cảnh.</li>\n</ul>\n<p><strong>34 Khoa lâm sàng.</strong></p>\n<ol>\n<li>Khoa Phẫu thuật – gây mê hồi sức.</li>\n<li>Khoa Hồi sức – phẫu thuật tim.</li>\n<li>Khoa Phẫu thuật mạch máu.</li>\n<li>Khoa Hồi sức cấp cứu.</li>\n<li>Khoa Hồi sức ngoại thần kinh.</li>\n<li>Khoa Chấn thương sọ não.</li>\n<li>Khoa Ngoại thần kinh (3B1,3B3, Đơn vị Gamma knife).</li>\n<li>Khoa Ngoại Tiêu hóa.</li>\n<li>Khoa Gan Mật Tụy.</li>\n<li>Khoa Ngoại Tiết Niệu.</li>\n<li>Khoa Chấn thương chỉnh hình.</li>\n<li>Khoa Tai Mũi họng.</li>\n<li>Khoa Tạo hình thẩm mỹ.</li>\n<li>Khoa Mắt.</li>\n<li>Khoa Ngoại lồng ngực.</li>\n<li>Khoa Nội tim mạch.</li>\n<li>Khoa Tim mạch can thiệp và Đơn vị Nhịp học.</li>\n<li>Khoa Nội phổi.</li>\n<li>Khoa Nội thận.</li>\n<li>Khoa Nội tiêu hóa.</li>\n<li>Khoa Nội thần kinh và Đơn vị Thăm dò chức năng thần kinh.</li>\n<li>Khoa Nội tổng quát (Lầu 9B1).</li>\n<li>Khoa Nội tổng quát – quốc tế (Lầu 10B1).</li>\n<li>Khoa Nội tổng quát (Lầu 10B3).</li>\n<li>Khoa Điều trị theo yêu cầu (T6).</li>\n<li>Khoa Bệnh nhiệt đới và Đơn vị Chống độc.</li>\n<li>Khoa Nghiên cứu &amp; điều trị viêm gan.</li>\n<li>Khoa Phỏng – tạo hình.</li>\n<li>Khoa Nội tiết và Đơn vị Bàn chân đái tháo đường.</li>\n<li>Khoa Nội cơ xương khớp.</li>\n<li>Khoa Huyết học lâm sàng - Bộ phận Xét nghiệm huyết học và Đơn vị Điều trị trong ngày.</li>\n<li>Khoa Cấp cứu.</li>\n<li>Khoa Thận nhân tạo.</li>\n<li>Khoa Vật lý trị liệu.</li>\n</ol>\n<p><strong>SƠ ĐỒ BỆNH VIỆN</strong></p>\n<p>Các trang web khác ghi địa chỉ Bệnh viện Việt Đức ở 40 Tràng Thi, đây là cổng chính nhưng thông thường chỉ dành cho những công việc giấy tờ, hành chính. Bệnh nhân đến khám sẽ đi các cổng phụ trên đường Phủ Doãn.</p>\n<p><img src=\"https://www.dchsystem.com/images/locations/regional-campus-map.jpg\" alt=\"\"></p>\n<p>Trên đường Phủ Doãn có 3 cổng và đường Tràng Thi có 1 cổng chính. Người bệnh nên đi đúng cổng như chỉ dẫn để đi đến phòng khám dễ dàng, nhanh chóng nhất.</p>\n<p><strong>QUY TRÌNH ĐI KHÁM</strong></p>\n<p>Quy trình khám dành cho người bệnh đặt khám thông qua BookingCare</p>\n<p>Dưới đây là Hướng dẫn làm thủ tục ưu tiên cho người bệnh đặt khám qua BookingCare tại Bệnh viện Hữu nghị Việt Đức.</p>\n<ol>\n<li>Bạn đến cổng số 16-18 Phủ Doãn</li>\n</ol>\n<p>Về nơi gửi xe:</p>\n<p>Xe máy gửi tại bãi đỗ xe trước cửa bệnh viện (có nhân viên bảo vệ hướng dẫn).\nXe ô tô gửi tại Cung Văn hóa Hữu nghị Việt Xô, cách bệnh viện khoảng 500m.</p>\n<ol start=\"2\">\n<li>\n<p>Bạn đến Tòa nhà C4: Tòa nhà thứ 2 bên tay trái từ cổng vào số 16-18 Phủ Doãn.</p>\n</li>\n<li>\n<p>Vào tầng 1, ĐẾN QUẦY CUNG CẤP THÔNG TIN BÁO ĐẶT QUA BOOKINGCARE để nhân viên hỗ trợ (xem thêm hình dưới).</p>\n</li>\n</ol>\n<p>Quý khách lấy số ưu tiên và chờ gọi số tại quầy đăng ký số 7,9 (phiếu khám đã được in sẵn, người bệnh KHÔNG cần khai báo thêm).\n4. Bạn sẽ nhận được phiếu khám có dán tem ưu tiên</p>\n<ol start=\"5\">\n<li>Bạn vào thẳng phòng khám, nộp phiếu khám, sổ khám bệnh và báo đã đặt khám qua BookingCare cho nhân viên điều dưỡng tại phòng để được ưu tiên khám.</li>\n</ol>\n<hr>\n',_binary 'data:image/jpeg;base64,',_binary 'data:image/avif;base64,','2024-10-24 18:05:42','2024-10-26 16:44:31');
INSERT INTO `clinics` VALUES (2,'Gan-Mật, Bệnh viện Chợ Rẫy','429 Tô Hiến Thành, Phường 14, Quận 10, Tp. Hồ Chí Minh ','**GIỚI THIỆU**\n\nBệnh viện Chợ Rẫy với lịch sử thành lập trên 100 năm, là bệnh viện hạng đặc biệt tuyến Trung ương lớn nhất cả nước với trên 1.800 giường và trên 3.000 kỹ thuật y tế được thực hiện. Hàng ngày Bệnh viện Chợ Rẫy tiếp nhận trung bình 6,000 -  8,000 bệnh nhân đến khám.\n\nBệnh viện Chợ Rẫy là bệnh viện đa khoa hoàn chỉnh, xếp hạng đặc biệt, tuyến kỹ thuật sau cùng các tỉnh thành phía Nam, trực thuộc Bộ Y tế. Thế mạnh nổi bật tại Bệnh viện Chợ Rẫy là sự kết hợp giữa các chuyên khoa mang lại hiệu quả tốt nhất trong việc chẩn đoán và điều trị cho người bệnh.\n\n**Địa chỉ bệnh viện:**\n201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh\n\nThời gian làm việc:\nBệnh viện làm việc, tiếp nhận khám bệnh cho bệnh nhân ngoại trú từ thứ 2 đến thứ 7 hàng tuần:\n\n* Thứ 2 đến thứ 6: từ 7h – 16h\n* Thứ 7: từ 7h – 11h\n\n**Lưu ý thông tin đặt lịch:** \n\nVui lòng kiểm tra kĩ thông tin cá nhân (họ tên, giới tính, năm sinh, địa chỉ, BHYT) trước khi xác nhận đặt lịch khám để tránh sai sót và tiết kiệm thời gian (Bệnh viện không chấp nhận với lịch sai thông tin) \nTrường hợp đặt sai thông tin, vui lòng đặt lại bằng số điện thoại khác (bắt buộc) \n\n**Lưu ý:**\n\nBệnh nhân thuộc những đối tượng được ưu tiên dưới đây, vui lòng đến trực tiếp bệnh viện đặt lịch khám để được hưởng quyền ưu tiên theo Luật khám chữa bệnh:\n\n* Người bệnh trong tình trạng cấp cứu\n* Trẻ em dưới 06 tuổi\n* Phụ nữ có thai\n* Người khuyết tật đặc biệt nặng\n* Người khuyết tật nặng\n* Người từ đủ 75 tuổi trở lên\n* Người có công với cách mạng\n* Sơ đồ Bệnh viện Chợ Rẫy\n\n**SƠ ĐỒ BỆNH VIỆN**\n\n![](https://raw.githubusercontent.com/baoduyne/Website/refs/heads/main/FE/src/assets/Lexington%2BMedical%2BCenter%2B6panel%2BAerial%2B(Low%2BRes%2BJPG)%2B08-30-19.jpg)\n\n hướng nhìn từ Công số 01\n\n**THẾ MẠNH CHUYÊN MÔN**\n* Bệnh viện có 05 Trung tâm\n* Trung tâm Ung bướu Chợ Rẫy.\n* Trung tâm Đào tạo – Chỉ đạo tuyến.\n* Trung tâm Thông tin thuốc và theo dõi phản ứng thuốc có hại của thuốc khu vực Thành phố HCM.\n* Trung tâm Truyền máu Chợ Rẫy.\n* Trung tâm Tim mạch.\n* 38 Khoa Lâm sàng\n\n04 Khoa khám bệnh ngoại trú:\n\n* Khoa Khám bệnh I\n* Khoa Khám bệnh II\n* Khoa Chăm sóc sức khỏe theo yêu cầu.\n* Khoa Khám xuất cảnh.\n* 34 Khoa lâm sàng.\n* \n* Khoa Phẫu thuật – gây mê hồi sức.\n* Khoa Hồi sức – phẫu thuật tim.\n* Khoa Phẫu thuật mạch máu.\n* Khoa Hồi sức cấp cứu.\n* Khoa Hồi sức ngoại thần kinh.\n* Khoa Chấn thương sọ não.\n* Khoa Ngoại thần kinh (3B1,3B3, Đơn vị Gamma knife).\n* Khoa Ngoại Tiêu hóa.\n* Khoa Gan Mật Tụy.\n* Khoa Ngoại Tiết Niệu.\n* Khoa Chấn thương chỉnh hình.\n* Khoa Tai Mũi họng.\n* Khoa Tạo hình thẩm mỹ.\n* Khoa Mắt.\n* Khoa Ngoại lồng ngực.\n* Khoa Nội tim mạch.\n* Khoa Tim mạch can thiệp và Đơn vị Nhịp học.\n* Khoa Nội phổi.\n* Khoa Nội thận.\n* Khoa Nội tiêu hóa.\n* Khoa Nội thần kinh và Đơn vị Thăm dò chức năng thần kinh.\n* Khoa Nội tổng quát (Lầu 9B1).\n* Khoa Nội tổng quát – quốc tế (Lầu 10B1).\n* Khoa Nội tổng quát (Lầu 10B3).\n* Khoa Điều trị theo yêu cầu (T6).\n* Khoa Bệnh nhiệt đới và Đơn vị Chống độc.\n* Khoa Nghiên cứu & điều trị viêm gan.\n* Khoa Phỏng – tạo hình.\n* Khoa Nội tiết và Đơn vị Bàn chân đái tháo đường.\n* Khoa Nội cơ xương khớp.\n* Khoa Huyết học lâm sàng - Bộ phận Xét nghiệm huyết học và Đơn vị Điều trị trong ngày.\n* Khoa Cấp cứu.\n* Khoa Thận nhân tạo.\n* Khoa Vật lý trị liệu.\n* Bệnh viện Chợ Rẫy tổ chức khám và điều trị hầu hết các bệnh lý bằng nội khoa, ngoại khoa, can thiệp,...\n\n**Bệnh Thần kinh**\n* Bệnh Cơ xương khớp\n* Bệnh tiêu hóa\n* Tim mạch\n* Phổi\n* Thận\n* Gan mật\n* Thận - Tiết niệu\n* Tai Mũi Họng\n* Chấn thương chỉnh hình\n* Mắt\n* Bệnh truyền nhiễm\n* Nội tiết\n* ...\n\n**QUY TRÌNH ĐI KHÁM**\n\nBước 1. Đến quầy tiếp nhận\nKhu nhà A\nĐến tầng trệt nhà A, Khoa khám bệnh, Cổng số 01 - Số 201B Nguyễn Chí Thanh Phường 12, Quận 5, Hồ Chí Minh (ĐẾN TRƯỚC GIỜ HẸN 30 phút)\nVào \"Khu nhận bệnh\" (tầng trệt, nhà A) để được hướng dẫn\nKhu nhà D\nĐến bệnh viện tại nhà D, Cổng số 6 - 184 Bà Triệu, Phường 12, Quận 5, Hồ Chí Minh (ĐẾN TRƯỚC GIỜ HẸN 30 phút)\nVào \"Quầy tiếp đón\" để được hướng dẫn\n\nBước 2. Vào phòng khám gặp bác sĩ\nChờ đến lượt, vào phòng khám đã đăng ký gặp bác sĩ\nKhu nhận bệnh nhân - Khoa khám bệnh Bệnh viện Chợ Rẫy\n\n**GIÁ KHÁM BỆNH**\n\nChi phí khám thường:\n\nBệnh nhân không có BHYT: Đóng 38.700 VNĐ/ lượt khám\nChi phí khám tại Bệnh viện theo qui định chung của Bộ Y tế\nMột số giấy tờ nên mang theo khi đi khám:\n\nThẻ bảo hiểm y tế còn hạn sử dụng\nChứng minh thư nhân dân hoặc giấy khai sinh (trẻ em)\nGiấy chuyển viện đến Bệnh viện Chợ Rẫy (nếu có)','<p><strong>GIỚI THIỆU</strong></p>\n<p>Bệnh viện Chợ Rẫy với lịch sử thành lập trên 100 năm, là bệnh viện hạng đặc biệt tuyến Trung ương lớn nhất cả nước với trên 1.800 giường và trên 3.000 kỹ thuật y tế được thực hiện. Hàng ngày Bệnh viện Chợ Rẫy tiếp nhận trung bình 6,000 -  8,000 bệnh nhân đến khám.</p>\n<p>Bệnh viện Chợ Rẫy là bệnh viện đa khoa hoàn chỉnh, xếp hạng đặc biệt, tuyến kỹ thuật sau cùng các tỉnh thành phía Nam, trực thuộc Bộ Y tế. Thế mạnh nổi bật tại Bệnh viện Chợ Rẫy là sự kết hợp giữa các chuyên khoa mang lại hiệu quả tốt nhất trong việc chẩn đoán và điều trị cho người bệnh.</p>\n<p><strong>Địa chỉ bệnh viện:</strong>\n201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh</p>\n<p>Thời gian làm việc:\nBệnh viện làm việc, tiếp nhận khám bệnh cho bệnh nhân ngoại trú từ thứ 2 đến thứ 7 hàng tuần:</p>\n<ul>\n<li>Thứ 2 đến thứ 6: từ 7h – 16h</li>\n<li>Thứ 7: từ 7h – 11h</li>\n</ul>\n<p><strong>Lưu ý thông tin đặt lịch:</strong></p>\n<p>Vui lòng kiểm tra kĩ thông tin cá nhân (họ tên, giới tính, năm sinh, địa chỉ, BHYT) trước khi xác nhận đặt lịch khám để tránh sai sót và tiết kiệm thời gian (Bệnh viện không chấp nhận với lịch sai thông tin)\nTrường hợp đặt sai thông tin, vui lòng đặt lại bằng số điện thoại khác (bắt buộc)</p>\n<p><strong>Lưu ý:</strong></p>\n<p>Bệnh nhân thuộc những đối tượng được ưu tiên dưới đây, vui lòng đến trực tiếp bệnh viện đặt lịch khám để được hưởng quyền ưu tiên theo Luật khám chữa bệnh:</p>\n<ul>\n<li>Người bệnh trong tình trạng cấp cứu</li>\n<li>Trẻ em dưới 06 tuổi</li>\n<li>Phụ nữ có thai</li>\n<li>Người khuyết tật đặc biệt nặng</li>\n<li>Người khuyết tật nặng</li>\n<li>Người từ đủ 75 tuổi trở lên</li>\n<li>Người có công với cách mạng</li>\n<li>Sơ đồ Bệnh viện Chợ Rẫy</li>\n</ul>\n<p><strong>SƠ ĐỒ BỆNH VIỆN</strong></p>\n<p><img src=\"https://raw.githubusercontent.com/baoduyne/Website/refs/heads/main/FE/src/assets/Lexington%2BMedical%2BCenter%2B6panel%2BAerial%2B(Low%2BRes%2BJPG)%2B08-30-19.jpg\" alt=\"\"></p>\n<p>hướng nhìn từ Công số 01</p>\n<p><strong>THẾ MẠNH CHUYÊN MÔN</strong></p>\n<ul>\n<li>Bệnh viện có 05 Trung tâm</li>\n<li>Trung tâm Ung bướu Chợ Rẫy.</li>\n<li>Trung tâm Đào tạo – Chỉ đạo tuyến.</li>\n<li>Trung tâm Thông tin thuốc và theo dõi phản ứng thuốc có hại của thuốc khu vực Thành phố HCM.</li>\n<li>Trung tâm Truyền máu Chợ Rẫy.</li>\n<li>Trung tâm Tim mạch.</li>\n<li>38 Khoa Lâm sàng</li>\n</ul>\n<p>04 Khoa khám bệnh ngoại trú:</p>\n<ul>\n<li>Khoa Khám bệnh I</li>\n<li>Khoa Khám bệnh II</li>\n<li>Khoa Chăm sóc sức khỏe theo yêu cầu.</li>\n<li>Khoa Khám xuất cảnh.</li>\n<li>34 Khoa lâm sàng.</li>\n<li></li>\n<li>Khoa Phẫu thuật – gây mê hồi sức.</li>\n<li>Khoa Hồi sức – phẫu thuật tim.</li>\n<li>Khoa Phẫu thuật mạch máu.</li>\n<li>Khoa Hồi sức cấp cứu.</li>\n<li>Khoa Hồi sức ngoại thần kinh.</li>\n<li>Khoa Chấn thương sọ não.</li>\n<li>Khoa Ngoại thần kinh (3B1,3B3, Đơn vị Gamma knife).</li>\n<li>Khoa Ngoại Tiêu hóa.</li>\n<li>Khoa Gan Mật Tụy.</li>\n<li>Khoa Ngoại Tiết Niệu.</li>\n<li>Khoa Chấn thương chỉnh hình.</li>\n<li>Khoa Tai Mũi họng.</li>\n<li>Khoa Tạo hình thẩm mỹ.</li>\n<li>Khoa Mắt.</li>\n<li>Khoa Ngoại lồng ngực.</li>\n<li>Khoa Nội tim mạch.</li>\n<li>Khoa Tim mạch can thiệp và Đơn vị Nhịp học.</li>\n<li>Khoa Nội phổi.</li>\n<li>Khoa Nội thận.</li>\n<li>Khoa Nội tiêu hóa.</li>\n<li>Khoa Nội thần kinh và Đơn vị Thăm dò chức năng thần kinh.</li>\n<li>Khoa Nội tổng quát (Lầu 9B1).</li>\n<li>Khoa Nội tổng quát – quốc tế (Lầu 10B1).</li>\n<li>Khoa Nội tổng quát (Lầu 10B3).</li>\n<li>Khoa Điều trị theo yêu cầu (T6).</li>\n<li>Khoa Bệnh nhiệt đới và Đơn vị Chống độc.</li>\n<li>Khoa Nghiên cứu &amp; điều trị viêm gan.</li>\n<li>Khoa Phỏng – tạo hình.</li>\n<li>Khoa Nội tiết và Đơn vị Bàn chân đái tháo đường.</li>\n<li>Khoa Nội cơ xương khớp.</li>\n<li>Khoa Huyết học lâm sàng - Bộ phận Xét nghiệm huyết học và Đơn vị Điều trị trong ngày.</li>\n<li>Khoa Cấp cứu.</li>\n<li>Khoa Thận nhân tạo.</li>\n<li>Khoa Vật lý trị liệu.</li>\n<li>Bệnh viện Chợ Rẫy tổ chức khám và điều trị hầu hết các bệnh lý bằng nội khoa, ngoại khoa, can thiệp,...</li>\n</ul>\n<p><strong>Bệnh Thần kinh</strong></p>\n<ul>\n<li>Bệnh Cơ xương khớp</li>\n<li>Bệnh tiêu hóa</li>\n<li>Tim mạch</li>\n<li>Phổi</li>\n<li>Thận</li>\n<li>Gan mật</li>\n<li>Thận - Tiết niệu</li>\n<li>Tai Mũi Họng</li>\n<li>Chấn thương chỉnh hình</li>\n<li>Mắt</li>\n<li>Bệnh truyền nhiễm</li>\n<li>Nội tiết</li>\n<li>...</li>\n</ul>\n<p><strong>QUY TRÌNH ĐI KHÁM</strong></p>\n<p>Bước 1. Đến quầy tiếp nhận\nKhu nhà A\nĐến tầng trệt nhà A, Khoa khám bệnh, Cổng số 01 - Số 201B Nguyễn Chí Thanh Phường 12, Quận 5, Hồ Chí Minh (ĐẾN TRƯỚC GIỜ HẸN 30 phút)\nVào &quot;Khu nhận bệnh&quot; (tầng trệt, nhà A) để được hướng dẫn\nKhu nhà D\nĐến bệnh viện tại nhà D, Cổng số 6 - 184 Bà Triệu, Phường 12, Quận 5, Hồ Chí Minh (ĐẾN TRƯỚC GIỜ HẸN 30 phút)\nVào &quot;Quầy tiếp đón&quot; để được hướng dẫn</p>\n<p>Bước 2. Vào phòng khám gặp bác sĩ\nChờ đến lượt, vào phòng khám đã đăng ký gặp bác sĩ\nKhu nhận bệnh nhân - Khoa khám bệnh Bệnh viện Chợ Rẫy</p>\n<p><strong>GIÁ KHÁM BỆNH</strong></p>\n<p>Chi phí khám thường:</p>\n<p>Bệnh nhân không có BHYT: Đóng 38.700 VNĐ/ lượt khám\nChi phí khám tại Bệnh viện theo qui định chung của Bộ Y tế\nMột số giấy tờ nên mang theo khi đi khám:</p>\n<p>Thẻ bảo hiểm y tế còn hạn sử dụng\nChứng minh thư nhân dân hoặc giấy khai sinh (trẻ em)\nGiấy chuyển viện đến Bệnh viện Chợ Rẫy (nếu có)</p>\n',_binary 'data:image/jpeg;base64,',_binary 'data:image/avif;base64,','2024-10-24 18:07:27','2024-10-26 16:45:18'),(3,'Doctor Check - Tầm Soát Bệnh Để Sống Thọ Hơn','429 Tô Hiến Thành, Phường 14, Quận 10, Tp. Hồ Chí Minh ','TRANG THIẾT BỊ\nĐội ngũ bác sĩ tại Doctor Check tin rằng, để trở thành Trung Tâm chuyên sâu về tầm soát bệnh, việc đầu tư trang thiết bị hiện đại là cực kỳ quan trọng. Do đó, trung tâm ưu tiên sử dụng hệ thống máy móc tiên tiến, đến từ các hãng đa quốc gia như Olympus, Fujifilm, Abbott, Roche,... để nâng cao năng lực tầm soát bệnh, giúp bạn phát hiện sớm các bất thường trong cơ thể.\n\nMáy nội soi Olympus EVIS X1 CV-1500\n\nBộ xử lý hình ảnh và nguồn sáng EVIS X1\nDây nội soi CV 1500 phóng đại 100 lần\nChức năng nhuộm ảo (hỗ trợ phát hiện tổn thương) NBI\nPhần mềm trí tuệ nhân tạo AI (hỗ trợ phát hiện polyp) EndoBRAIN – EYE\nMàn hình nội soi 32 inches chuẩn 4K\nHình ảnh nội soi tại trung tâm\n\nMáy nội soi Fujifilm 7000\n\nBộ xử lý hình ảnh và nguồn sáng EP 7000\nDây nội soi EP 7000 phóng đại 135 lần\nChức năng nhuộm ảo (hỗ trợ phát hiện tổn thương) BLI-LCI\nPhần mềm trí tuệ nhân tạo AI (hỗ trợ phát hiện polyp) EX-1\nMàn hình nội soi 24 inches chuẩn Full HD.\nMáy siêu âm màu ACSON Juniper (Siemens - Mỹ)\n\nĐầu dò Convex dãi tần 1.4 – 5.0 MHz\nĐầu dò Linear dãi tần 2.6 – 11.5 MHz \nHệ thống chụp X - quang kỹ thuật số\n\nMáy chụp X – quang cao tần 500mA: Vikomed (Liên danh Việt – Hàn)\nTấm nhận ảnh kỹ thuật số: IRAY – Hàn Quốc\nMáy in phim X – quang: Agfa – Ý \nHệ thống máy xét nghiệm\n\nMáy xét nghiệm Huyết Học: Ruby (Abbott – Mỹ)\nMáy xét nghiệm Sinh Hóa\nMiễn Dịch: CI 4100 (Abbott – Mỹ)\nMáy xét nghiệm Đông Máu: Cobas T 411 (Roche – Thụy Sĩ)\nMáy xét nghiệm Nước Tiểu: Cobas 1100 (Roche – Thụy Sĩ)\nKính hiển vi quan sát: CX-31 (Olympus – Nhật)\nMáy đo H. pylori bằng phương pháp hơi thở C13\n\nThiết bị đo: FanHp (Fisher – Đức)\nThuốc thổi: Infai – Đức\nVỊ TRÍ\nTrung tâm Tiêu hóa Doctor Check nằm tại 429 Tô Hiến Thành, Phường 14, Quận 10, Tp. Hồ Chí Minh \n\nBản đồ nơi khám','<p>TRANG THIẾT BỊ\nĐội ngũ bác sĩ tại Doctor Check tin rằng, để trở thành Trung Tâm chuyên sâu về tầm soát bệnh, việc đầu tư trang thiết bị hiện đại là cực kỳ quan trọng. Do đó, trung tâm ưu tiên sử dụng hệ thống máy móc tiên tiến, đến từ các hãng đa quốc gia như Olympus, Fujifilm, Abbott, Roche,... để nâng cao năng lực tầm soát bệnh, giúp bạn phát hiện sớm các bất thường trong cơ thể.</p>\n<p>Máy nội soi Olympus EVIS X1 CV-1500</p>\n<p>Bộ xử lý hình ảnh và nguồn sáng EVIS X1\nDây nội soi CV 1500 phóng đại 100 lần\nChức năng nhuộm ảo (hỗ trợ phát hiện tổn thương) NBI\nPhần mềm trí tuệ nhân tạo AI (hỗ trợ phát hiện polyp) EndoBRAIN – EYE\nMàn hình nội soi 32 inches chuẩn 4K\nHình ảnh nội soi tại trung tâm</p>\n<p>Máy nội soi Fujifilm 7000</p>\n<p>Bộ xử lý hình ảnh và nguồn sáng EP 7000\nDây nội soi EP 7000 phóng đại 135 lần\nChức năng nhuộm ảo (hỗ trợ phát hiện tổn thương) BLI-LCI\nPhần mềm trí tuệ nhân tạo AI (hỗ trợ phát hiện polyp) EX-1\nMàn hình nội soi 24 inches chuẩn Full HD.\nMáy siêu âm màu ACSON Juniper (Siemens - Mỹ)</p>\n<p>Đầu dò Convex dãi tần 1.4 – 5.0 MHz\nĐầu dò Linear dãi tần 2.6 – 11.5 MHz\nHệ thống chụp X - quang kỹ thuật số</p>\n<p>Máy chụp X – quang cao tần 500mA: Vikomed (Liên danh Việt – Hàn)\nTấm nhận ảnh kỹ thuật số: IRAY – Hàn Quốc\nMáy in phim X – quang: Agfa – Ý\nHệ thống máy xét nghiệm</p>\n<p>Máy xét nghiệm Huyết Học: Ruby (Abbott – Mỹ)\nMáy xét nghiệm Sinh Hóa\nMiễn Dịch: CI 4100 (Abbott – Mỹ)\nMáy xét nghiệm Đông Máu: Cobas T 411 (Roche – Thụy Sĩ)\nMáy xét nghiệm Nước Tiểu: Cobas 1100 (Roche – Thụy Sĩ)\nKính hiển vi quan sát: CX-31 (Olympus – Nhật)\nMáy đo H. pylori bằng phương pháp hơi thở C13</p>\n<p>Thiết bị đo: FanHp (Fisher – Đức)\nThuốc thổi: Infai – Đức\nVỊ TRÍ\nTrung tâm Tiêu hóa Doctor Check nằm tại 429 Tô Hiến Thành, Phường 14, Quận 10, Tp. Hồ Chí Minh</p>\n<p>Bản đồ nơi khám</p>\n',_binary 'data:image/jpeg;base64,',_binary 'data:image/avif;base64,','2024-10-24 18:17:57','2024-10-26 15:02:14');
INSERT INTO `clinics` VALUES (4,' Phòng khám Bệnh viện Đại học Y Dược 1','20-22 Dương Quang Trung, Phường 12, Quận 10, Tp. HCM','\nGIỚI THIỆU\nPhòng Khám Bệnh viện Đại học Y Dược 1 là Phòng Khám đầu tiên được thành lập theo mô hình hợp tác công - tư. Đây là phòng khám đa khoa, thuộc hệ thống các cơ sở của Bệnh viện Đại học Y Dược TP.HCM.\n\nCác bác sĩ tại Phòng khám Bệnh viện Đại học Y Dược 1 chủ yếu là đã và đang công tác trong chính Bệnh viện Đại học Y Dược TP.HCM, Bệnh viện Chợ Rẫy, bác sĩ tại Bệnh viện Nhân Dân 115 và các bệnh viện uy tín khác trên địa bàn thành phố.\n\nHơn nữa, phòng khám còn được đầu tư về hệ thống trang thiết bị thăm khám và điều trị đồng bộ. Một số thiết bị điển hình phải kể đến như: Máy chụp MRI, Máy chụp CT-Scanner, Máy đo loãng xương, các loại máy đo chức năng hô hấp,.... Vì vậy, phòng khám được rất nhiều người bệnh tin tưởng thăm khám.\n\nĐịa chỉ: 20-22 Dương Quang Trung, Phường 12, Quận 10, Tp. Hồ Chí Minh\n\nThời gian làm việc\n\nThứ 2 tới thứ 6: 07h30 - 16h30\nThứ 7: 07h30 - 12h00\nLưu ý quan trọng\n\nNgười bệnh nên chú ý địa chỉ phòng khám (vì có những người nhầm với địa chỉ Bệnh viện Đại học Y Dược TP.HCM cơ sở 1). Bệnh viện Đại học Y Dược TP.HCM cơ sở 1 và Phòng khám Bệnh viện Đại học Y Dược 1 là khác nhau, địa chỉ cũng tách rời nhau. \nKhi đi khám, muộn nhất 15h45 (thứ 2 - thứ 6) và 11h15 (thứ 7) người bệnh phải có mặt ở phòng khám. Nếu được nên đi khám trước 2-3 tiếng thời gian kết thúc để có thể làm xét nghiệm, chụp chiếu xong.\nTHẾ MẠNH CHUYÊN MÔN\nPhòng khám Bệnh viện Đại học Y Dược 1 là phòng khám đa khoa, chuyên về Nội khoa. Một số chuyên khoa thế mạnh của phòng khám có thể kể đến như:\n\nCác gói khám sức khỏe định kỳ cho cá nhân và doanh nghiệp\nChẩn đoán hình ảnh: chụp Xquang, cộng hưởng từ MRI, cắt lớp vi tính CT-Scan, siêu âm tim, siêu âm. \nCơ Xương Khớp\nHô hấp & Dị ứng Miễn dịch\nNhi khoa\nNội Tiêu hóa - Viêm gan\nSản - Phụ khoa\nTai Mũi Họng\nTim mạch\nTrong các chuyên khoa thế mạnh, Khám tổng quát là dịch vụ được nhiều người sử dụng nhất ở phòng khám. Tại đây, các gói khám được lên danh mục sẵn với chi phí rõ ràng, cùng với sự hỗ trợ từ thiết bị máy móc tân tiến cùng đội ngũ bác sĩ nhiều năm kinh nghiệm giúp quá trình khám tổng quát diễn ra hiệu quả.\n\nNhưng cũng chính vì vậy, nhiều thời điểm phòng khám khá đông đúc như vào buổi sáng các ngày đầu tuần. Bạn đọc có thể lựa chọn đi khám vào các ngày gần cuối tuần và đặt hẹn trước để tiết kiệm thời gian thăm khám.\n\n \n\nTRANG THIẾT BỊ\nPhòng Khám Bệnh viện Đại học Y Dược 1 TP.HCM được đầu tư cơ sở vật chất khang trang và trang thiết bị máy móc hiện đại của các thương hiệu hàng đầu thế giới như GE, Fuji, Olympus, Kart Stoz, Phillip,…:\n\nMáy chụp cộng hưởng từ MRI 1.5 Tesla: Hỗ trợ hiệu quả trong xem xét các hình ảnh bất thường, tổn thương trong cơ xương khớp, cột sống, sọ não,...\nMáy chụp cắt lớp CT scanner 128: Giúp bác sĩ phát hiện các bất thường tại các phần mềm như lồng ngực, bụng, khung chậu, não bộ,...\nCác loại máy đo chức năng hô hấp: Máy hô hấp ký, máy đo đa ký giấc ngủ: Hỗ trợ hiệu quả trong khám và chẩn đoán cho người bệnh mắc các bệnh về hô hấp như hen suyễn, bệnh phổi tắc nghẽn mãn tính, ngưng thở khi ngủ,...\nCác loại máy móc thông thường khác cũng được trang bị như: Máy chụp X-Quang, Máy đo loãng xương, Máy siêu âm tim, siêu âm 4D, Hệ thống máy xét nghiệm, Máy nội soi tiêu hóa, nội soi tai mũi họng….','<p>GIỚI THIỆU\nPhòng Khám Bệnh viện Đại học Y Dược 1 là Phòng Khám đầu tiên được thành lập theo mô hình hợp tác công - tư. Đây là phòng khám đa khoa, thuộc hệ thống các cơ sở của Bệnh viện Đại học Y Dược TP.HCM.</p>\n<p>Các bác sĩ tại Phòng khám Bệnh viện Đại học Y Dược 1 chủ yếu là đã và đang công tác trong chính Bệnh viện Đại học Y Dược TP.HCM, Bệnh viện Chợ Rẫy, bác sĩ tại Bệnh viện Nhân Dân 115 và các bệnh viện uy tín khác trên địa bàn thành phố.</p>\n<p>Hơn nữa, phòng khám còn được đầu tư về hệ thống trang thiết bị thăm khám và điều trị đồng bộ. Một số thiết bị điển hình