, Kart Stoz, Phillip,…:</p>\n<p>Máy chụp cộng hưởng từ MRI 1.5 Tesla: Hỗ trợ hiệu quả trong xem xét các hình ảnh bất thường, tổn thương trong cơ xương khớp, cột sống, sọ não,...\nMáy chụp cắt lớp CT scanner 128: Giúp bác sĩ phát hiện các bất thường tại các phần mềm như lồng ngực, bụng, khung chậu, não bộ,...\nCác loại máy đo chức năng hô hấp: Máy hô hấp ký, máy đo đa ký giấc ngủ: Hỗ trợ hiệu quả trong khám và chẩn đoán cho người bệnh mắc các bệnh về hô hấp như hen suyễn, bệnh phổi tắc nghẽn mãn tính, ngưng thở khi ngủ,...\nCác loại máy móc thông thường khác cũng được trang bị như: Máy chụp X-Quang, Máy đo loãng xương, Máy siêu âm tim, siêu âm 4D, Hệ thống máy xét nghiệm, Máy nội soi tiêu hóa, nội soi tai mũi họng….</p>\n',_binary 'data:image/jpeg;base64,',_binary 'data:image/avif;base64,','2024-10-24 18:20:42','2024-10-26 15:02:57'),(5,'Bệnh viện Ung bướu Hưng Việt','34 Đại Cồ Việt, Hai Bà Trưng, Hà Nội','GIỚI THIỆU\nBệnh viện Ung Bướu Hưng Việt là bệnh viện chuyên khoa Ung Bướu tư nhân đầu tiên tại Việt Nam. Bệnh viện được định hướng phát triển thành đơn vị chăm sóc sức khỏe toàn diện sánh ngang với các bệnh viện trong khu vực và quốc tế. \n\nĐiểm đặc biệt của bệnh viện, đội ngũ bác sĩ trực tiếp thăm khám đều là các chuyên gia đầu ngành, trưởng phó khoa của các bệnh viện lớn, chuyên sâu điều trị ung bướu: Bệnh viện K Trung ương, Bệnh viện Bạch Mai, Bệnh viện Việt Đức,... Hơn nữa, hệ thống trang thiết bị hỗ trợ khám và điều trị ung bướu được biệt viện chú trọng đầu tư, mang lại sự thuận tiện và hiệu quả tối ưu cho quá trình điều trị ung bướu.\n\nSự kết hợp của đội ngũ bác sĩ giỏi cùng hệ thống trang thiết bị được đầu tư, thông tin bác sĩ rõ ràng, người bệnh có thể dễ dàng đặt hẹn với bác sĩ mong muốn cùng sự hỗ trợ tận tình của đội ngũ nhân viên, Bệnh viện Hưng Việt đã trở thành địa chỉ khám và điều trị ung bướu tin cậy được nhiều người lựa chọn.\n\nĐịa chỉ: Số 34 Đường Đại Cồ Việt, Hai Bà Trưng, Hà Nội\n\nThời gian làm việc: Tất cả các ngày trong tuần (kể cả ngày lễ Tết)\n\nBuổi sáng: 07h00 - 12h00\nBuổi chiều: 13h30 - 17h00\nTHẾ MẠNH CHUYÊN MÔN\nBệnh viện hiện tập trung vào điều trị một số nhóm bệnh ung bướu cụ thể:\n\nTuyến vú\nTuyến giáp\nTiêu hóa\nĐầu - mặt - cổ\nBên cạnh đó, các bác sĩ tại bệnh viện vân thăm khám các nhóm bệnh thông thường gặp phải của các chuyên khoa:\n\nTiêu hóa\nTai mũi họng\nNội tiết\nHô hấp\nTRANG THIẾT BỊ\nBệnh viện được trang bị đầy đủ thiết bị hỗ trợ thăm khám và điều trị ung thư hiệu quả:\n\nMáy gia tốc tuyến tính đa năng Elekta Synergy PlatForm: là máy xạ trị gia tốc hiện đại trong điều trị ung thư, có thể xạ trị được hầu hết các bệnh ung thư được chỉ định, tối ưu hoá rất cao liều xạ vào tổn thương đích (u, hạch) và hạn chế ảnh hưởng đến tổ chức lành, giảm thiểu tác dụng phụ. Hơn nữa, còn tiết kiệm thời gian so với phương pháp xạ trị ung thư thông thường khác. Đặc biệt loại máy này còn có thể tiến hành xạ trị các khối u ở các cơ quan di động mà các máy móc trước đây không thể thực hiện được.\nMáy nội soi tiêu hóa EVIS EXERA III (CV-190): Thiết bị hỗ trợ bác sĩ xác định hiệu quả các tổn thương và bất thường trong khi nội soi nhờ công nghệ xử lý chất lượng hình ảnh vượt trội, tích hợp chức năng nội soi qua dải tần hẹp (NBI), hình ảnh được chụp sắc nét ngay lần đầu tiên. \nMáy chụp Xquang vú (mamography): Giúp xác định các tổn thương ở mô tuyến vú.\nMáy chụp CT-Scanner: Hỗ trợ hữu ích trong chẩn đoán các tổn thương vùng ngực đặc biệt là ung thư phổi, tủy sống, vùng bụng,...\nMáy chụp MRI: Giúp hỗ trợ hiệu quả trong chẩn đoán các tổn thương hệ thần kinh, mạch não, tim mạch tuyến vú, vùng chậu,...\nTrung tâm hóa trị: Tùy thuộc vào loại ung bướu và tình trạng, người bệnh sẽ được các bác sĩ lên kế hoạch điều trị với hóa chất theo liều tối ưu. Trung tâm thường xuyên cập nhật kiến thức mới, phác đồ điều trị tiên tiến, hóa chất ít tác dụng phụ để ngày một nâng cao hiệu quả điều trị cho người bệnh.\nBên cạnh đó, các phòng lưu trú của bệnh viện cũng được đầu tư để bệnh nhân có khu vực nghỉ ngơi thuận tiện, thoải mái trong thời gian điều trị.\n\nHình ảnh các loại máy móc:\n\nMáy gia tốc tuyến tính\nmáy gia tốc tuyến tính xạ trị ung thư tại Bệnh viện Hưng Việt\n\nMáy nội soi tiêu hóa có chức năng nội soi với dải tần hẹp (NBI)\nMáy nội soi tiêu hóa hiện đại tại Bệnh viện Hưng Việt\n\nMáy Chụp Xquang tuyến vú\n\n\nVỊ TRÍ\nBệnh viện Ung bướu Hưng Việt nằm ngay trên trục đường Đại Cồ Việt\n\n\n\nQUY TRÌNH ĐI KHÁM\nDưới đây là hướng dẫn đường đi và hướng dẫn làm thủ tục cho khách hàng đặt khám qua BookingCare tại Bệnh viện Ung bướu Hưng Việt\n\n1. Bạn đến Bệnh viện Ung bướu Hưng Việt, 40 Đại Cồ Việt, Hai Bà Trưng, Hà Nội (cơ sở phòng khám).\n\nLưu ý nơi gửi xe:\n\nXe máy: bạn có thể gửi tại tại trước cửa phòng khám\nÔ tô: Bạn có thể hỏi bảo vệ để được hướng dẫn chỗ gửi xe tại phố Hoa Lư (cách Bệnh viện 15m)\n2. Bạn vào quầy lễ tân tầng 1, báo đã đặt khám qua BookingCare và đưa mã QR (Mã trong hướng dẫn đi khám) cho nhân viên để được quét mã làm thủ tục khám.','<p>GIỚI THIỆU\nBệnh viện Ung Bướu Hưng Việt là bệnh viện chuyên khoa Ung Bướu tư nhân đầu tiên tại Việt Nam. Bệnh viện được định hướng phát triển thành đơn vị chăm sóc sức khỏe toàn diện sánh ngang với các bệnh viện trong khu vực và quốc tế.</p>\n<p>Điểm đặc biệt của bệnh viện, đội ngũ bác sĩ trực tiếp thăm khám đều là các chuyên gia đầu ngành, trưởng phó khoa của các bệnh viện lớn, chuyên sâu điều trị ung bướu: Bệnh viện K Trung ương, Bệnh viện Bạch Mai, Bệnh viện Việt Đức,... Hơn nữa, hệ thống trang thiết bị hỗ trợ khám và điều trị ung bướu được biệt viện chú trọng đầu tư, mang lại sự thuận tiện và hiệu quả tối ưu cho quá trình điều trị ung bướu.</p>\n<p>Sự kết hợp của đội ngũ bác sĩ giỏi cùng hệ thống trang thiết bị được đầu tư, thông tin bác sĩ rõ ràng, người bệnh có thể dễ dàng đặt hẹn với bác sĩ mong muốn cùng sự hỗ trợ tận tình của đội ngũ nhân viên, Bệnh viện Hưng Việt đã trở thành địa chỉ khám và điều trị ung bướu tin cậy được nhiều người lựa chọn.</p>\n<p>Địa chỉ: Số 34 Đường Đại Cồ Việt, Hai Bà Trưng, Hà Nội</p>\n<p>Thời gian làm việc: Tất cả các ngày trong tuần (kể cả ngày lễ Tết)</p>\n<p>Buổi sáng: 07h00 - 12h00\nBuổi chiều: 13h30 - 17h00\nTHẾ MẠNH CHUYÊN MÔN\nBệnh viện hiện tập trung vào điều trị một số nhóm bệnh ung bướu cụ thể:</p>\n<p>Tuyến vú\nTuyến giáp\nTiêu hóa\nĐầu - mặt - cổ\nBên cạnh đó, các bác sĩ tại bệnh viện vân thăm khám các nhóm bệnh thông thường gặp phải của các chuyên khoa:</p>\n<p>Tiêu hóa\nTai mũi họng\nNội tiết\nHô hấp\nTRANG THIẾT BỊ\nBệnh viện được trang bị đầy đủ thiết bị hỗ trợ thăm khám và điều trị ung thư hiệu quả:</p>\n<p>Máy gia tốc tuyến tính đa năng Elekta Synergy PlatForm: là máy xạ trị gia tốc hiện đại trong điều trị ung thư, có thể xạ trị được hầu hết các bệnh ung thư được chỉ định, tối ưu hoá rất cao liều xạ vào tổn thương đích (u, hạch) và hạn chế ảnh hưởng đến tổ chức lành, giảm thiểu tác dụng phụ. Hơn nữa, còn tiết kiệm thời gian so với phương pháp xạ trị ung thư thông thường khác. Đặc biệt loại máy này còn có thể tiến hành xạ trị các khối u ở các cơ quan di động mà các máy móc trước đây không thể thực hiện được.\nMáy nội soi tiêu hóa EVIS EXERA III (CV-190): Thiết bị hỗ trợ bác sĩ xác định hiệu quả các tổn thương và bất thường trong khi nội soi nhờ công nghệ xử lý chất lượng hình ảnh vượt trội, tích hợp chức năng nội soi qua dải tần hẹp (NBI), hình ảnh được chụp sắc nét ngay lần đầu tiên.\nMáy chụp Xquang vú (mamography): Giúp xác định các tổn thương ở mô tuyến vú.\nMáy chụp CT-Scanner: Hỗ trợ hữu ích trong chẩn đoán các tổn thương vùng ngực đặc biệt là ung thư phổi, tủy sống, vùng bụng,...\nMáy chụp MRI: Giúp hỗ trợ hiệu quả trong chẩn đoán các tổn thương hệ thần kinh, mạch não, tim mạch tuyến vú, vùng chậu,...\nTrung tâm hóa trị: Tùy thuộc vào loại ung bướu và tình trạng, người bệnh sẽ được các bác sĩ lên kế hoạch điều trị với hóa chất theo liều tối ưu. Trung tâm thường xuyên cập nhật kiến thức mới, phác đồ điều trị tiên tiến, hóa chất ít tác dụng phụ để ngày một nâng cao hiệu quả điều trị cho người bệnh.\nBên cạnh đó, các phòng lưu trú của bệnh viện cũng được đầu tư để bệnh nhân có khu vực nghỉ ngơi thuận tiện, thoải mái trong thời gian điều trị.</p>\n<p>Hình ảnh các loại máy móc:</p>\n<p>Máy gia tốc tuyến tính\nmáy gia tốc tuyến tính xạ trị ung thư tại Bệnh viện Hưng Việt</p>\n<p>Máy nội soi tiêu hóa có chức năng nội soi với dải tần hẹp (NBI)\nMáy nội soi tiêu hóa hiện đại tại Bệnh viện Hưng Việt</p>\n<p>Máy Chụp Xquang tuyến vú</p>\n<p>VỊ TRÍ\nBệnh viện Ung bướu Hưng Việt nằm ngay trên trục đường Đại Cồ Việt</p>\n<p>QUY TRÌNH ĐI KHÁM\nDưới đây là hướng dẫn đường đi và hướng dẫn làm thủ tục cho khách hàng đặt khám qua BookingCare tại Bệnh viện Ung bướu Hưng Việt</p>\n<ol>\n<li>Bạn đến Bệnh viện Ung bướu Hưng Việt, 40 Đại Cồ Việt, Hai Bà Trưng, Hà Nội (cơ sở phòng khám).</li>\n</ol>\n<p>Lưu ý nơi gửi xe:</p>\n<p>Xe máy: bạn có thể gửi tại tại trước cửa phòng khám\nÔ tô: Bạn có thể hỏi bảo vệ để được hướng dẫn chỗ gửi xe tại phố Hoa Lư (cách Bệnh viện 15m)\n2. Bạn vào quầy lễ tân tầng 1, báo đã đặt khám qua BookingCare và đưa mã QR (Mã trong hướng dẫn đi khám) cho nhân viên để được quét mã làm thủ tục khám.</p>\n',_binary 'data:image/jpeg;base64,',_binary 'data:image/avif;base64,','2024-10-24 18:28:55','2024-10-26 15:07:04');
INSERT INTO `clinics` VALUES (8,'Trung tâm Khám sức khỏe định kỳ, Bệnh viện Trung ương Quân đội 108','Số 1B Trần Hưng Đạo, Quận Hai Bà Trưng, Hà Nội','\nGIỚI THIỆU\nTrung tâm khám sức khỏe định kỳ - Bệnh viện Trung ương Quân đội 108 là đơn vị đầu ngành thực hiện chức năng khám sức khỏe định kỳ cho các cá nhân, nhóm, cơ quan. Hiện nay có khá ít bệnh viện công tuyến trung ương triển khai dịch vụ gói khám một cách chuyên nghiệp như Trung tâm khám sức khỏe định kỳ.\n\nVì vậy, Trung tâm khám sức khỏe định kỳ của Bệnh viện luôn là địa chỉ uy tín hàng đầu của người dân khi đi khám tổng quát:\n\nĐược thăm khám với các Giáo sư, Phó giáo sư, Tiến sỹ, Bác sĩ chuyên khoa có trình độ cao và đội ngũ điều dưỡng chuyên nghiệp cùng hệ thống trang thiết bị đồng bộ, hiện đại hàng đầu Việt Nam.\nĐược khám với quy trình khép kín, không phải di chuyển nhiều.\nĐược tự thiết kế những danh mục trong gói khám theo mong muốn và tư vấn của bác sĩ.\nKhu vực khám riêng tư, lịch sự.\nĐược lấy máu xét nghiệm tại khu riêng, giảm thiểu thời gian chờ đợi.\nTất cả các gói khám tổng quát đều bao gồm suất ăn miễn phí cho khách hàng tại Bệnh viện sau khi lấy mẫu máu xét nghiệm.\nĐịa chỉ: Tầng 2 Trung tâm Khám sức khỏe định kỳ, Bệnh viện Trung ương quân đội 108\n\nKhu khám Trung tâm Khám sức khỏe định kỳ\n\nThời gian làm việc:\n\n6h30 - 17h00 (Nên Đến trước 8h30 để làm thủ tục khám nếu không thì dịch vụ siêu âm, nội soi có thể đẩy sang chiều hoặc ngày hôm sau phụ thuộc vào số lượng bệnh nhân trong ngày)\nKhám cá nhân: Thứ 2 - Thứ 6\nKhám đoàn và công ty: Thứ 7\nTHẾ MẠNH CHUYÊN MÔN\nTrung tâm khám sức khỏe định kì, thực hiện các dịch vụ:\n\nKhám theo yêu cầu với Bác sĩ Chuyên khoa.\nKhám theo các gói khám có sẵn hoặc linh hoạt xây dựng gói khám theo nhu cầu cá nhân. \nTất cả các gói khám tổng quát đều bao gồm suất ăn miễn phí cho khách hàng tại Bệnh viện sau khi lấy mẫu máu xét nghiệm.\n\nTRANG THIẾT BỊ\nTrung tâm khám sức khỏe định kì được trang bị hệ thống trang thiết bị đồng bộ, hiện đại hàng đầu Việt Nam đáp ứng như cầu thăm khám của người bệnh:\n\nHệ thống cộng hưởng từ MRI: 2 máy MRI 1.5 Tesla, 2 máy MRI 3.0 Tesla: Phục vụ hiệu quả trong việc hỗ trợ chẩn đoán, phát hiện các khối bất thường.\nMáy chụp CT320 dãy: Giúp phát hiện các hình ảnh bất thường ở những lát chụp rất nhỏ, hiệu quả hơn trong chẩn đoán và điều trị.\n12 máy Xquang kỹ thuật số\nChụp vú kỹ thuật số, chụp vú 3D, chụp vú có tiêm thuốc cản quang, sinh thiết vú định vị\nVới hệ thống máy móc được trang bị đầy đủ, số lượng máy cũng được chú trọng để giúp bệnh nhân không phải chờ đợi quá lâu trong quá trình thăm khám tại trung tâm.\n\n\n\n(Hệ thống chụp cổng hưởng từ 3.0 Tesla)\n\nVỊ TRÍ\nBệnh viện Trung ương Quân đội 108 nằm gần ngã tư đường Trần Khánh Dư và đường Trần Hưng Đạo.\n\n\n\nQUY TRÌNH ĐI KHÁM\nQuy trình đi khám tại TRUNG TÂM KHÁM SỨC KHỎE ĐỊNH KÌ - BV 108\n\nĐịa chỉ: Cổng 1B Trần Hưng Đạo, Hoàn Kiếm, Hà Nội\n\n1. Quý khách đến TÒA NHÀ 4 TẦNG và hỏi lên TẦNG 2 TRUNG TÂM KHÁM SỨC KHỎE ĐỊNH KÌ\n\nXe máy bạn có thể gửi tại nhà gửi xe bên tay phải cổng chính. Tuy nhiên, nhà xe này thường xuyên ùn tắc\nXe ô tô: Bạn hỏi nhân viên bảo vệ để được hướng dẫn nơi gửi xe.\n\n\n2. Quý khách vào quầy tiếp đón báo đã đặt lịch khám qua BookingCare để được ưu tiên hỗ trợ \n\n\n\nVideo hướng dẫn đi khám \n\n\n\nLưu ý: \n\n1. Quý khách vui lòng đến trước 8h30 làm thủ tục khám, đến sau 10h30 sẽ không nhận lịch. (Nếu đến sau 8h30 thì dịch vụ siêu âm, nội soi có thể đẩy sang chiều hoặc ngày hôm sau phụ thuộc vào số lượng bệnh nhân trong ngày).  \n\n2. BookingCare sẽ hỗ trợ quý khách được ưu tiên khám với bác sĩ. Các dịch vụ cận lâm sàng sẽ theo sự sắp xếp của bệnh viện. \n\n3. Trong trường hợp bác sĩ nghỉ khám, quý khách sẽ đươc bệnh viện chuyển sang bác sĩ khác có chuyên môn tương đương. \n\n4. Với những xét nghiệm máu chuyên sâu thời gian trả kết quả lâu có thể phải chuyển sang ngày hôm sau để đọc kết quả. ','<p>GIỚI THIỆU\nTrung tâm khám sức khỏe định kỳ - Bệnh viện Trung ương Quân đội 108 là đơn vị đầu ngành thực hiện chức năng khám sức khỏe định kỳ cho các cá nhân, nhóm, cơ quan. Hiện nay có khá ít bệnh viện công tuyến trung ương triển khai dịch vụ gói khám một cách chuyên nghiệp như Trung tâm khám sức khỏe định kỳ.</p>\n<p>Vì vậy, Trung tâm khám sức khỏe định kỳ của Bệnh viện luôn là địa chỉ uy tín hàng đầu của người dân khi đi khám tổng quát:</p>\n<p>Được thăm khám với các Giáo sư, Phó giáo sư, Tiến sỹ, Bác sĩ chuyên khoa có trình độ cao và đội ngũ điều dưỡng chuyên nghiệp cùng hệ thống trang thiết bị đồng bộ, hiện đại hàng đầu Việt Nam.\nĐược khám với quy trình khép kín, không phải di chuyển nhiều.\nĐược tự thiết kế những danh mục trong gói khám theo mong muốn và tư vấn của bác sĩ.\nKhu vực khám riêng tư, lịch sự.\nĐược lấy máu xét nghiệm tại khu riêng, giảm thiểu thời gian chờ đợi.\nTất cả các gói khám tổng quát đều bao gồm suất ăn miễn phí cho khách hàng tại Bệnh viện sau khi lấy mẫu máu xét nghiệm.\nĐịa chỉ: Tầng 2 Trung tâm Khám sức khỏe định kỳ, Bệnh viện Trung ương quân đội 108</p>\n<p>Khu khám Trung tâm Khám sức khỏe định kỳ</p>\n<p>Thời gian làm việc:</p>\n<p>6h30 - 17h00 (Nên Đến trước 8h30 để làm thủ tục khám nếu không thì dịch vụ siêu âm, nội soi có thể đẩy sang chiều hoặc ngày hôm sau phụ thuộc vào số lượng bệnh nhân trong ngày)\nKhám cá nhân: Thứ 2 - Thứ 6\nKhám đoàn và công ty: Thứ 7\nTHẾ MẠNH CHUYÊN MÔN\nTrung tâm khám sức khỏe định kì, thực hiện các dịch vụ:</p>\n<p>Khám theo yêu cầu với Bác sĩ Chuyên khoa.\nKhám theo các gói khám có sẵn hoặc linh hoạt xây dựng gói khám theo nhu cầu cá nhân.\nTất cả các gói khám tổng quát đều bao gồm suất ăn miễn phí cho khách hàng tại Bệnh viện sau khi lấy mẫu máu xét nghiệm.</p>\n<p>TRANG THIẾT BỊ\nTrung tâm khám sức khỏe định kì được trang bị hệ thống trang thiết bị đồng bộ, hiện đại hàng đầu Việt Nam đáp ứng như cầu thăm khám của người bệnh:</p>\n<p>Hệ thống cộng hưởng từ MRI: 2 máy MRI 1.5 Tesla, 2 máy MRI 3.0 Tesla: Phục vụ hiệu quả trong việc hỗ trợ chẩn đoán, phát hiện các khối bất thường.\nMáy chụp CT320 dãy: